%[text] # Newton–Raphson Method Demonstration
%[text] This live script demonstrates the **Newton–Raphson iteration** for finding roots of nonlinear equations. It provides:
%[text] - A theoretical description using LaTeX mathematics.
%[text] - Two practical examples: - Case 1: Initial guess close to a root (convergent). - Case 2: Initial guess far from the root (divergent or convergent to a different root). \
%[text] The method is visualized graphically at each iteration.
%[text] ## The Newton–Raphson Algorithm
%[text] The Newton–Raphson method is an iterative root-finding technique based on the first-order Taylor expansion of a differentiable function $f(x)$.
%[text] Starting from an initial guess $x\_0$, the iteration formula is:
%[text] $x\_{n+1} = x\_n - \\frac{f(x\_n)}{f'(x\_n)}$
%[text] The geometric interpretation: at each iteration, we approximate $f(x)$ near $x\_n$ by its tangent line and use the intersection with the $x$-axis as the next iterate $x\_{n+1}$.
%[text] The convergence is typically **quadratic** **if** $f'(x^\*) \\neq 0$ near the root $x^\*$.
%[text] However, convergence strongly depends on the initial guess $x\_0$. Bad initial guesses may lead to divergence or convergence to a **different root**.
%[text] ## Define the Function and Its Derivative
%[text] We will use the nonlinear function:
%[text] $f(x) = x^3 - 2x + 2$
%[text] which has one real root near $x \\approx -1.7693$.
f = @(x) x.^3 - 2*x + 2;        % Function
df = @(x) 3*x.^2 - 2;           % Derivative
%%
%[text] ## Newton–Raphson Iteration Function
%[text] This helper function performs Newton–Raphson iterations and visualizes each step.
function newton_demo(f, df, x0, maxIter, tol, titleStr)
    figure; hold on; grid on;
    fplot(f, [-3, 3], 'LineWidth', 1.5);
    yline(0, 'k--');
    xlabel('x'); ylabel('f(x)');
    title(['Newton–Raphson Iterations: ', titleStr]);

    colors = lines(maxIter);
    x = x0;
    for n = 1:maxIter
        fx = f(x);
        dfx = df(x);
        if abs(dfx) < 1e-8
            disp('Derivative too small — stopping iteration.');
            break;
        end

        % Compute next point
        x_next = x - fx/dfx;

        % Plot tangent line
        x_line = linspace(x-1, x+1, 100);
        tangent = fx + dfx*(x_line - x);
        plot(x_line, tangent, '--', 'Color', colors(n,:), 'LineWidth', 1.2);
        plot(x, fx, 'o', 'Color', colors(n,:), 'MarkerFaceColor', colors(n,:));
        plot([x x_next], [fx 0], ':', 'Color', colors(n,:), 'LineWidth', 1);

        % Display iteration info
        disp(['Iter ', num2str(n), ': x = ', num2str(x), ', f(x) = ', num2str(fx)]);

        if abs(fx) < tol
            break;
        end
        x = x_next;
    end

    plot(x, 0, 'ks', 'MarkerFaceColor', 'y', 'MarkerSize', 8);
    legend('f(x)', 'y=0', 'Iterations', 'Location', 'best');
end
%%
%[text] ## Example 1 — Good Initial Guess (Convergent)
%[text] Let the initial guess be $x\_0 = -1.5$, which is close to the actual root. We expect rapid convergence.
x0 = -1.5;
maxIter = 6;
tol = 1e-6;
newton_demo(f, df, x0, maxIter, tol, 'Convergent Case (x_0 = -1.5)'); %[output:25901ead] %[output:9b3abb5f]
%%
%[text] ## Example 2 — Poor Initial Guess (Converges to Different Root)
%[text] Let the initial guess be $x\_0 = 2$. The iteration will likely converge to a **different** root or even diverge.
%[text] This illustrates the **sensitivity** of Newton–Raphson to the initial condition.
x0 = 2;
maxIter = 10;
newton_demo(f, df, x0, maxIter, tol, 'Divergent or Wrong Root Case (x_0 = 2)'); %[output:2ec84c01] %[output:37107ee2]
%%
%[text] ## Discussion
%[text] - When $x\_0$ is near the true root, Newton–Raphson converges quadratically.
%[text] - When $x\_0$ is far, the tangent may lead to a distant point, causing divergence or convergence to another root.
%[text] - The derivative $f'(x)$ must not be zero or too small. \
%[text] In practice, **visual inspection** of $f(x)$ helps select a suitable initial guess.

